INSERT INTO `v1_9fb6fe7c37eac0470f6544c0b286d93e3461fa55e98cf17117f2d6d034deef18` VALUES (11, 101311, 0.5, 8, 0, "アンナたそアンナたそ！\nおせち料理、美味しそうですぞ！\nさあ、おあがりよ！！", 0, 311, 0, 0, 311010);
