INSERT INTO `v1_9fb6fe7c37eac0470f6544c0b286d93e3461fa55e98cf17117f2d6d034deef18` VALUES (11, 105111, 0.5, 8, 0, "医食同源……って知ってるかしら？\n長寿を願う料理には、なにかしらの\n効能があるものも多いのよ。", 0, 311, 0, 0, 311014);
INSERT INTO `v1_9fb6fe7c37eac0470f6544c0b286d93e3461fa55e98cf17117f2d6d034deef18` VALUES (91, 311014, "", "", "", "", "", 311, "", "", 311015);
