INSERT INTO `v1_9fb6fe7c37eac0470f6544c0b286d93e3461fa55e98cf17117f2d6d034deef18` VALUES (11, 104511, 0.5, 5, 0, "クウカはこんな新年早々に\n豪華な料理とたくさんの人の前で\nドSさんに弄ばれ辱めを……！\nぐふふ……ぐふふふふ。", 0, 513, 0, 1, 513048);
